ExprLine.OrigStr:
DeclareType("RowData", "InteractOption");
if (RowData.InteractString = "")
	Translate("Interact.Default");
else
	RowData.InteractString;
endif

DeclareType("RowData", "InteractOption");
if (RowData.Category = "Mission")
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Mission_Available_Small");
elif (RowData.Category = "Info")
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Information_Important_Small");
elif (RowData.Category = "Warp")
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Travel");
elif (RowData.Category = "CrimeComputer")
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Crime_Computer_Small");
elif (RowData.CanPickup = 1)
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_PickUpItem_Small");
elif (RowData.CanThrow = 1)
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_PickUpItem_Small");
### This does not work on other languages, need to fix!
elif (GenStringStartsWith(RowData.InteractString, "Travel"))
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Travel");
elif (GenStringStartsWith(RowData.InteractString, "Teleport"))
	GenSetEarlyOverrideString(Self, "Texture", "Item_Config_Gear_Gold");
elif (GenStringStartsWith(RowData.InteractString, "Talk"))
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Talk_Small");
elif (GenStringStartsWith(RowData.InteractString, "Enter Powerhouse"))
	GenSetEarlyOverrideString(Self, "Texture", "Map_Icon_Power_Trainer_Small");
else
	GenSetEarlyOverrideString(Self, "Texture", "Item_Config_Gear_Gold");
endif
